import React, { useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Stepper from "@material-ui/core/Stepper";
import Step from "@material-ui/core/Step";
import StepLabel from "@material-ui/core/StepLabel";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import Information from "./Information";
import Education from "./Education";
import Grid from "@material-ui/core/Grid";
import ActivityWork from "./ActivityWork";
import Container from "@material-ui/core/Container";
import ContextWorks from "./ContextWorks";
import Summary from "../components/Summary";
import Data from "../Data/questionData";
import Data2 from "../Data/contentData";
import Chart from "./summaryChart";
import DataCal from "../components/Table/Calculator";

const useStyles = makeStyles((theme) => ({
  root: {},
  backButton: {
    marginRight: theme.spacing(1),
  },
  instructions: {
    marginTop: theme.spacing(1),
    marginBottom: theme.spacing(1),
  },
}));

function getSteps() {
  return [
    "ข้อมูลส่วนบุคคล",
    "ประวัติการศึกษา",
    "กิจกรรมการทำงาน",
    "บริบทการทำงาน",
    "สรุปการประเมิน",
  ];
}

export default function HorizontalLabelPositionBelowStepper() {
  const classes = useStyles();

  // setStateReact
  const [information, setInformation] = useState({
    title: undefined,
    firstName: undefined,
    lastName: undefined,
    idCard: undefined,
    age: undefined,
    gender: undefined,
  });

  const [educations, setEducations] = React.useState({
    educate: undefined,
    majorName: undefined,
  });

  const [values, setValues] = React.useState(Data);

  const [values2, setValues2] = React.useState(Data2);

  const [activeStep, setActiveStep] = React.useState(0);

  // เกี่ยวกับ stepper
  const steps = getSteps();

  const handleNext = (activeStep) => {
    setActiveStep((prevActiveStep) => prevActiveStep + 1);
  };

  const handleStay = () => {};

  const handleBack = () => {
    setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  //  validate
  const validateID = (id) => {
    if (id === undefined || id === null) {
      return false;
    }

    // eslint-disable-next-line eqeqeq
    if (id.length != 13) {
      return false;
    }
    if (id.length === 13) {
      var i, sum;
      for (i = 0, sum = 0; i < 12; i++)
        sum += parseFloat(id.charAt(i)) * (13 - i);
      if ((11 - (sum % 11)) % 10 !== parseFloat(id.charAt(12))) {
        alert("เลขบัตรประจำตัวประชาชนผิด");
        return false;
      }
      return true;
    }
  };

  const validateFirstName = (id) => {
    if (id === undefined || id === null) {
      return false;
    }
    if (id.length > 50) {
      alert("ชื่อมีขนาดตัวอักษรเกินกว่า 50 ตัว");
      return false;
    } else {
      return true;
    }
  };

  const validateLastName = (id) => {
    console.log("call validate", information.lastName);
    if (id === undefined || id === null) {
      console.log("not have lastName");
      return false;
    }
    if (id.length > 50) {
      alert("นามสกุลมีขนาดตัวอักษรเกินกว่า 50 ตัว");
      console.log("eror");
      return false;
    } else {
      return true;
    }
  };
  const validateTitle = (id) => {
    if (id === undefined || id === null) {
      return false;
    } else {
      return true;
    }
  };
  const validateGender = (id) => {
    console.log("call validate", information.gender);
    if (id === undefined || id === null) {
      return false;
    } else {
      return true;
    }
  };
  const validateAge = (id) => {
    console.log("call validate", information.age);
    if (id === undefined || id === null) {
      return false;
    }
    if (id < 10) {
      return false;
    }
    if (id > 71) {
      return false;
    } else {
      return true;
    }
  };
  const validateEducate = (id) => {
    console.log("call validate", educations.educate);
    if (id === undefined || id === null) {
      return false;
    } else {
      return true;
    }
  };
  const validateMajor = (id) => {
    console.log("call validate", educations.majorName);
    if (id === undefined || id === null) {
      return false;
    } else {
      return true;
    }
  };

  const validateFirstStep = () => {
    if (
      validateTitle(information.title) &&
      validateGender(information.gender) &&
      validateFirstName(information.firstName) &&
      validateLastName(information.lastName) &&
      validateID(information.idCard) &&
      validateAge(information.age)
    ) {
      return true;
    }
  };

  const validateTwoStep = () => {
    if (
      validateEducate(educations.educate) &&
      validateMajor(educations.majorName)
    ) {
      return true;
    }
  };

  // ทำ validate ในแต่ละหน้า
  const onSubmit = (step) => {
    console.log("X1", X1());
    console.log("X", X());
    console.log("sd", getSD1());
    console.log("d0", d0_1());
    console.log("d", d1());
    console.log("get", getRp1());
    if (step === 0) {
      if (validateFirstStep()) {
        return true;
      }
    }
    if (step === 1) {
      if (validateTwoStep()) {
        return true;
      }
    }
    if (step === 2) {
      if (validateTwoStep()) {
        return true;
      }
    }
    if (step === 3) {
      if (validateTwoStep()) {
        return true;
      }
    }
    if (step === 4) {
      if (validateTwoStep()) {
        return true;
      }
    }
  };
  function getPoint(id) {
    var point;
    point = id + 1.0;
    return point;
  }
  function X1() {
    var sum, x;
    sum =
      getPoint(values[0].value) +
      getPoint(values[1].value) +
      getPoint(values[2].value) +
      getPoint(values[3].value) +
      getPoint(values[4].value) +
      getPoint(values[5].value) +
      getPoint(values[6].value);
    x = sum / 7;

    return x;
  }

  function X2() {
    var sum, x;
    sum =
      getPoint(values[7].value) +
      getPoint(values[8].value) +
      getPoint(values[9].value) +
      getPoint(values[10].value) +
      getPoint(values[11].value) +
      getPoint(values[12].value);
    x = sum / 6;

    return x;
  }
  function X3() {
    var sum, x;
    sum =
      getPoint(values[13].value) +
      getPoint(values[14].value) +
      getPoint(values[15].value) +
      getPoint(values[16].value) +
      getPoint(values[17].value) +
      getPoint(values[18].value) +
      getPoint(values[19].value);
    x = sum / 7;

    return x;
  }
  function X4() {
    var sum, x;
    sum =
      getPoint(values[20].value) +
      getPoint(values[21].value) +
      getPoint(values[22].value) +
      getPoint(values[23].value) +
      getPoint(values[24].value);

    x = sum / 5;

    return x;
  }
  function X5() {
    var sum, x;
    sum =
      getPoint(values[25].value) +
      getPoint(values[26].value) +
      getPoint(values[27].value) +
      getPoint(values[28].value) +
      getPoint(values[29].value);

    x = sum / 5;

    return x;
  }
  function X6() {
    var sum, x;
    sum =
      getPoint(values[30].value) +
      getPoint(values[31].value) +
      getPoint(values[32].value) +
      getPoint(values[33].value);

    x = sum / 4;

    return x;
  }
  function X7() {
    var sum, x;
    sum =
      getPoint(values[34].value) +
      getPoint(values[35].value) +
      getPoint(values[36].value);
    x = sum / 3;

    return x;
  }
  function X8() {
    var sum, x;
    sum = getPoint(values[37].value) + getPoint(values[38].value);

    x = sum / 2;

    return x;
  }
  function X9() {
    var sum, x;
    sum = getPoint(values[39].value) + getPoint(values[40].value);
    x = sum / 2;

    return x;
  }
  function X() {
    var i, sum, x;
    for (i = 0, sum = 0; i < 41; i++) sum += getPoint(values[i].value);
    x = sum / 41;

    return x;
  }
  function getSD1() {
    var sum, pow, sqr;
    sum = X1() * 7 - X() * 7;
    pow = Math.pow(sum, 2) / 7;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD2() {
    var sum, pow, sqr;
    sum = sum = X2() * 6 - X() * 6;
    pow = Math.pow(sum, 2) / 6;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD3() {
    var sum, pow, sqr;
    sum = X3() * 7 - X() * 7;
    pow = Math.pow(sum, 2) / 7;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD4() {
    var sum, pow, sqr;
    sum = X4() * 5 - X() * 5;
    pow = Math.pow(sum, 2) / 5;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD5() {
    var sum, pow, sqr;
    sum = X5() * 5 - X() * 5;
    pow = Math.pow(sum, 2) / 5;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD6() {
    var sum, pow, sqr;
    sum = X6() * 4 - X() * 4;
    pow = Math.pow(sum, 2) / 4;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD7() {
    var sum, pow, sqr;
    sum = X7() * 3 - X() * 3;
    pow = Math.pow(sum, 2) / 3;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD8() {
    var sum, pow, sqr;
    sum = X8() * 2 - X() * 2;
    pow = Math.pow(sum, 2) / 2;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD9() {
    var sum, pow, sqr;
    sum = X9() * 2 - X() * 2;
    pow = Math.pow(sum, 2) / 2;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  // d0
  function d0_1() {
    var d0;
    d0 = (X1() - X()) / getSD1();
    return d0;
  }
  function d0_2() {
    var d0;
    d0 = (X2() - X()) / getSD2();
    return d0;
  }
  function d0_3() {
    var d0;
    d0 = (X3() - X()) / getSD3();
    return d0;
  }
  function d0_4() {
    var d0;
    d0 = (X4() - X()) / getSD4();
    return d0;
  }
  function d0_5() {
    var d0;
    d0 = (X1() - X()) / getSD5();
    return d0;
  }
  function d0_6() {
    var d0;
    d0 = (X6() - X()) / getSD6();
    return d0;
  }
  function d0_7() {
    var d0;
    d0 = (X7() - X()) / getSD7();
    return d0;
  }
  function d0_8() {
    var d0;
    d0 = (X8() - X()) / getSD8();
    return d0;
  }
  function d0_9() {
    var d0;
    d0 = (X9() - X()) / getSD9();
    return d0;
  }
  //get sum d^2
  function d1() {
    var d, result;

    d =
      Math.pow(d0_1() + 0.96, 2) +
      Math.pow(d0_2() + 0.6, 2) +
      Math.pow(d0_3() + 1.4, 2) +
      Math.pow(d0_4() - 0.47, 2) +
      Math.pow(d0_5() + 0.41, 2) +
      Math.pow(d0_6() + 0.01, 2) +
      Math.pow(d0_7() + 0.21, 2) +
      Math.pow(d0_8() + 0.37, 2) +
      Math.pow(d0_9() + 0.33, 2);
