    return result;
  }
  function d2() {
    var d, result;
    d =
      Math.pow(d0_1() - 0.47, 2) +
      Math.pow(d0_2() - 0.46, 2) +
      Math.pow(d0_3() - 0.56, 2) +
      Math.pow(d0_4() - 0.28, 2) +
