  function d5() {
    var d, result;
    d =
      Math.pow(d0_1() - 0.03, 2) +
      Math.pow(d0_2() + 0.49, 2) +
      Math.pow(d0_3() + 0.77, 2) +
      Math.pow(d0_4() + 1.02, 2) +
